            i--;
        else j++;
    }
    return false;
}

面试题6_从尾到头打印链表.html.body:
题目描述
输入一个链表，按链表从尾到头的顺序返回一个ArrayList。
解法一
利用栈先入后出的特性，可将链表倒置。
时间复杂度为O(n)，空间复杂度为O(n)。
public ArrayList printListFromTailToHead(ListNode listNode) {
    Stack stack = new Stack<>();
    while (listNode != null) {
        stack.add(listNode.val);
        listNode = listNode.next;
    }

    ArrayList list = new ArrayList<>();
    while (!stack.isEmpty())
        list.add(stack.pop());

    return list;
}

解法二
递归本质就是一个栈结构，很自然地想到递归。
时间复杂度为O(n)，空间复杂度为O(n)。
public ArrayList printListFromTailToHead(ListNode listNode) {
    // 1.递归终止的条件
    if (listNode == null)
        return new ArrayList<>();

    // 2.找返回值
    ArrayList list = printListFromTailToHead(listNode.next);

    // 3.本级递归应该做什么
    list.add(listNode.val);
    return list;
}

面试题8_二叉树的下一个节点.html.body:
题目描述
给定一个二叉树和其中的一个结点，请找出中序遍历顺序的下一个结点并且返回。注意，树中的结点不仅包含左右子结点，同时包含指向父结点的指针。
解法一
这道题可以分三种情况讨论：

pNode有右孩子，那么下一个节点是其右孩子的最左子节点。
pNode没有右孩子且是其父节点的左孩子，那么下一个节点是其父节点。
pNode没有右孩子且是其父节点的右孩子。则沿其父节点指针一直向上遍历，直到找到一个是它父节点的左子节点的节点，如果这样的节点存在，那么这个节点的父节点就是我们要找的节点。如果这样的节点不存在，根节点就是我们要找的节点。

public TreeLinkNode GetNext(TreeLinkNode pNode) {
    if (pNode == null)
        return null;
    TreeLinkNode pNext = null;
    if (pNode.right != null) {
        TreeLinkNode p = pNode.right;
        while (p.left != null)
            p = p.left;
        pNext = p;
    } else if (pNode.next != null){
        TreeLinkNode pCurrent = pNode;
        TreeLinkNode pParent = pNode.next;
        while (pParent != null && pCurrent == pParent.right) {
            pCurrent = pParent;
            pParent = pParent.next;
        }
        pNext = pParent;
    }
    return pNext;
}

